import {fetchItem} from './request.js'

export function getAllItems() {
    return dispatch => {
        fetchItem()
        .then (user =>dispatch (
            {type: "GET_ALL_SERVICES_SUCCEED",payload: user}) 
        )

        .catch(err=>dispatch( {
            type: "GET_ALL_SERVICES_FAILED",
            payload: err
          }))
    }

}
